import React from "react";

const Clock = () => {
  return (
    <div className="clock__wrapper d-flex align-items-center gap-5">
      <div className="clock__data d-flex align-items-center gap-5">
        <div>
          <h1>10</h1>
          <h5>Days</h5>
        </div>
      </div>
    </div>
  );
};

export default Clock;
